import './App.css';

import React, { useState } from 'react';

const App = () => {
  const [data, setData] = useState(null);

  const params = {
    param1: 'value1',
    param2: 'value2'
  };

const searchParams = new URLSearchParams(params);

  // Fetch data from server when component mounts
  React.useEffect(() => {
    fetch(`http://localhost:3000/db?${searchParams}`)
      .then(response => response.json())
      .then(data => {
        setData(data);
      });
  }, []);

  // Render the data or a loading message
  return (
    <div>
      {data ? (
        // Render the data
        <div>{data.array.rows.map(element => {
          return <div>element</div>
        })}
        </div>
      ) : (
        // Render a loading message
        <div>Loading...</div>
      )}
    </div>
  );
};



export default App;
